import React from 'react';


const Marker = (props) => {
    const createMarkers = props.address.map((object, index)=>{
        if (object.keys.length === 0){
         console.log("here is false object inside of marker", object)
        }
        return (
            <div className="marker" 
            style={{ cursor: 'pointer'}}
            position={object}
            key={index} />
        )
    })
    return (
      <div>
          {createMarkers}
      </div>
    )
  };
  export default Marker
